import React from 'react';
import {Card} from 'react-bootstrap'

const CardPic = props => {

    return(

        <Card className="bg-dark text-white">
            <Card.Img src={props.image} alt="" />
            <Card.ImgOverlay>
                <Card.Title>{props.title}</Card.Title>
                <Card.Text>
                {props.description}
                </Card.Text>
            </Card.ImgOverlay>
            </Card>
    )
}

export default CardPic;
